import React, { Component } from 'react';
import { Segment } from 'semantic-ui-react';


class OpeningPage extends Component {
	render() {
		return(
			<div className='opening-page'>
				<Segment>
					<button>
						Enter
					</button>
				</Segment>
			</div>
		)
	}
}

export default OpeningPage;
